import React from 'react';
import Github from './icons/Github';

const data = {
  "social": [
    {
      "name": "github",
      "link": "https://github.com/egiurleo",
      "svg": <Github />
    },
    {
      "name": "twitter",
      "link": "https://twitter.com/egiurleo",
      "svg": <Github />
    }
  ]
}

export default data;
